import React from "react";
import { Container, Row } from "react-bootstrap";
import Day from "./Day";

const Calendar = () => {
    const week = [1,2,3,4,5,6,7];

    return(
        <Container>
            <Row>
                {week.map(day => <Day key={day} date={day} />)}
            </Row>
        </Container>
    );
};

export default Calendar;
